const initialState = {
    data: {
        'picture': 'https://ikebana-app-users.s3-sa-east-1.' +
                        'amazonaws.com/default/default_user.png',
    }
}

export default (state = initialState, action) => {
    switch(action.type) {
        default: {
            return state;
        }
    }
}
